import { HttpClient } from '@angular/common/http';
import { Component, Inject } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
  public items: items[] = [];

  constructor(http: HttpClient) {
    http.get<items[]>('http://localhost:5077/WeatherForecast').subscribe({
      next: (value) => {
        this.items = value;
      },
      error: (err) => {
        console.log(err);
      },
    });
  }
}

interface items {
  uID: number;
  FName: string;
  Username: string;
  Password: string;
}
